window.bookSummaryJSON = "<p>Having been bolstered with the supplies sufficient to carry them through the winter, the survivors of the Jackson commune must now hunker down and endure the bitter Wyoming snows, while to the south, factions are beginning to form, coalescing from the ashes of the dead world.</p> <p>Out in Arizona, the leftovers of the US Military encamped in the last known surviving tent city: the Elysium Fields.</p> <p>In Nevada, a clan of scavengers grows ever larger, each day bringing them a step closer to collapsing under their own weight.</p> <p>Resources are becoming scarcer by the day as the world trudges on, and as it so happens, the folks up in Wyoming appear to be sitting on prime real estate....</p>"; 
